import React, { Component } from "react";
import { Navbar, Nav as BootNav } from "react-bootstrap";

class Nav extends Component {
  render() {
    return (
      <Navbar bg="light" expand="lg" fixed="top">
        <Navbar.Brand href="/">StatsDash</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="mr-auto">
            <BootNav.Link href="/">About</BootNav.Link>
            <BootNav.Link href="#">Dashboard</BootNav.Link>
            <BootNav.Link href="#">Log Out</BootNav.Link>
          </Nav>
        </Navbar.Collapse>
      </Navbar>
    );
  }
}
export default Nav;
